import React from "react";
import IngredientStatic from "../data/IngredientStatic";

const Ingredient = () => {
  const ingredientArrObj = IngredientStatic;
  console.log(ingredientArrObj[0]);
  const ingredientList = ingredientArrObj.map(
    (ingredient) =>
      ingredient.name +
      " " +
      ingredient.amount.metric.value +
      ingredient.amount.metric.unit
  );
  const displayIngredients = ingredientList.map((ingredient) => {
    return <p>{ingredient}</p>;
  });

  return (
    <div className="container">
      Ingredient Container
      <div className="row">
        <div className="col-6">{displayIngredients}</div>
        <div className="col-6">Col2</div>
      </div>
    </div>
  );
};

export default Ingredient;
